import './App.css';

// Router
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom'

//Pagas
import Home from './pages/Home/Home';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home /> } />
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
